@Inspiredbyta shows us how sports can inspire the world. Tim Alexander was one of the top players in the nation with a dream to play for @UAB_FB. In 2006, he was paralyzed in a car crash. Doctors said he would never walk again, but Tim promised he’d make a return to the gridiron. He kept a positive attitude and worked out on the UAB campus every day. The program noticed his determination making him the first paraplegic to receive a division one football scholarship. He became the team’s sideline motivator. Still, he was unable to stand up.
_

In 2014, the program shut down. Tim promised he would bring football back to Birmingham. He became the driving force of the movement to reinstate the program, traveling across the state to meet with councils, gaining supporters. This past Saturday, Tim fulfilled both of his promises. UAB made a triumphant return in their first game back. Tim stood up from his wheelchair and carried the game ball to midfield. Thanks for showing us how sports can change the world, Tim.

